INSERT INTO `electronic_text` VALUES ('api.schema.DHL', '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<ECommerce action=\"Request\" version=\"1.1\">\n    <Requestor> \n        <ID>${userid}</ID>\n        <Password>${password}</Password>\n    </Requestor>\n    <Shipment action=\"${action}\" version=\"1.0\"> \n        <ShippingCredentials> \n          <ShippingKey>${shippingKey}</ShippingKey>\n          <AccountNbr>${accountNbr}</AccountNbr>\n        </ShippingCredentials>\n       <ShipmentDetail> \n          <ShipDate>${shipDate?string(\"yyyy-MM-dd\")}</ShipDate> \n          <Service><Code>${dhlShipmentDetailCode}</Code></Service> \n          <ShipmentType><Code>P</Code></ShipmentType>\n          <Weight>${weight}</Weight>\n          <ContentDesc>${contentDesc?if_exists}</ContentDesc>\n          <ShipperReference>${shipperReference?if_exists}</ShipperReference>\n          <#if (dimensions?if_exists) && (dimensions != null) && (dimensions.size() > 0) > \n            <Dimensions>\n                <Height>${dimensions.get(\"height\")}</Height>\n                <Width>${dimensions.get(\"width\")}</Width>\n                <Length>${dimensions.get(\"length\")}</Length>\n            </Dimensions>\n          </#if>\n      </ShipmentDetail>\n      <Billing> \n           <Party><Code>S</Code></Party> \n      </Billing> \n      <Sender>\n        <SentBy>${sentBy?if_exists}</SentBy> <!-- CDATA (if left out, will default to information stored in our account -->\n        <PhoneNbr>${senderPhoneNbr?if_exists}</PhoneNbr>\n      </Sender>\n      <Receiver> \n          <Address>\n            <#if (action == \"GenerateLabel\")>\n                <CompanyName>${companyName?if_exists?upper_case?xml}</CompanyName>  <!-- CDATA -->\n                <SuiteDepartmentName>${suiteDepartmentName?if_exists?upper_case?xml}</SuiteDepartmentName> <!-- CDATA -->\n                <Street>${street?upper_case?xml}</Street> <!-- CDATA -->\n                <StreetLine2>${streetLine2?if_exists?upper_case?xml}</StreetLine2> <!-- CDATA -->\n                <City>${city?upper_case?xml}</City> <!-- CDATA -->\n            </#if>\n            <State>${state}</State>\n            <PostalCode>${postalCode}</PostalCode>\n            <Country>US</Country>\n         </Address> \n         <AttnTo>${attnTo?if_exists?upper_case}</AttnTo> <!--CDATA -->\n         <PhoneNbr>${phoneNbr}</PhoneNbr>\n      </Receiver>\n      <ShipmentProcessingInstructions>\n        <#if labelImageType?exists>\n            <Label><ImageType>${labelImageType}</ImageType></Label>\n        </#if>\n        <#if overrideCode?exists>\n            <Overrides><Override><Code>${overrideCode}</Code></Override></Overrides>\n        </#if>\n        <#if notifyEmailAddress?exists>\n            <Notification>\n               <!-- TODO: up to 42 of these -->\n               <Notify><EmailAddress>${notifyEmailAddress?if_exists}</EmailAddress></Notify>\n               <#if notifyEmailMessage?has_content>\n               <!-- CDATA here -->\n               <Message>${notifyEmailMessage}</Message>\n               </#if> \n            </Notification>\n        </#if>\n      </ShipmentProcessingInstructions>\n  </Shipment>\n</ECommerce>\n', '2008-09-03 16:05:13', '2008-09-03 16:05:13', '2008-09-03 16:05:13', '2008-09-03 16:05:13');
INSERT INTO `electronic_text` VALUES ('BLG10000', 'Hey, if I write this stuff for free, I sure as heck am going to put my kid\'s picture up there if I want to.\n\n<p/>\n\nThis is an example of a complex blog entry that uses the screen widgets to combine text and images. \n\n\n\nIf you want to see what the editing environment look like, log in as \"bigal/ofbiz\".\n\n', '2008-09-03 16:06:20', '2008-09-03 16:06:19', '2008-09-03 16:06:20', '2008-09-03 16:06:19');
INSERT INTO `electronic_text` VALUES ('BLG10002', 'Cutest kid in the whole world.  This section is the \"SUMMARY\" section. It is stored separately from the main content.', '2008-09-03 16:06:20', '2008-09-03 16:06:19', '2008-09-03 16:06:20', '2008-09-03 16:06:19');
INSERT INTO `electronic_text` VALUES ('BLG10003', 'This certainly is the cutest kid I have ever seen.\n\n\n\n- Maxwell\'s (Cutest Kid in the World) mother', '2008-09-03 16:06:20', '2008-09-03 16:06:19', '2008-09-03 16:06:20', '2008-09-03 16:06:19');
INSERT INTO `electronic_text` VALUES ('BLG10004', 'So what am I - chopped liver? How come I can\'t upload my picture?\n\n\n\n- Joseph (Max\'s baby brother - age 7 months)', '2008-09-03 16:06:20', '2008-09-03 16:06:19', '2008-09-03 16:06:20', '2008-09-03 16:06:19');
INSERT INTO `electronic_text` VALUES ('BLG10005', 'Sorry dear, but you look too much like your father. Hopefully, you get something from him that may lessen the handicap with which you have been saddled. :0(\n\n\n\n- Mom', '2008-09-03 16:06:20', '2008-09-03 16:06:19', '2008-09-03 16:06:20', '2008-09-03 16:06:19');
INSERT INTO `electronic_text` VALUES ('BLG10006', 'Our leaders have long since stopped being leaders and become moral barometers instead, and believe me there is a storm a`comin. I can understand rich Americans voting for rich politicians because they share a common interest. What I can\'t understand is middle class Americans voting for rich politicians in the hopes that they can hold on to the little bit more money they have than the Democrats. What is even sadder is the less well-off who vote for some good-looking joe who has no more in common with them than the man-in-the-moon because it makes them feel like they are like him - reality TV.', '2008-09-03 16:06:20', '2008-09-03 16:06:19', '2008-09-03 16:06:20', '2008-09-03 16:06:19');
INSERT INTO `electronic_text` VALUES ('BLG10007', 'The 2008 Elections more like a reality show than anything meaningful.', '2008-09-03 16:06:20', '2008-09-03 16:06:19', '2008-09-03 16:06:20', '2008-09-03 16:06:19');
INSERT INTO `electronic_text` VALUES ('BLG10008', 'I think one requirement for attaining the office of President should be that you don\'t want it. That you are drafted by the will of the people and dragged kicking and screaming to the position should be the process.', '2008-09-03 16:06:20', '2008-09-03 16:06:19', '2008-09-03 16:06:20', '2008-09-03 16:06:19');
INSERT INTO `electronic_text` VALUES ('BLG10009', 'This is not any kind of hero worship; it is pragmatic marketing. You need a profile to attach to dynamic movements, if for no reason other than to pick fights with your competion - \"our icon is more enigmatic than your icon\". You need someone for publications to write articles about and \"the next Linus Torvalds\" is just the sort of catch phrase they would pick up on.\n\n<p/>\n\nDavid won\'t like it. He will probably delete this seed data from the DB, but it is not really about him. He gave up his right to privacy when he chose to pursue the glamorous life of an open source software developer. We could choose someone else, but no one else knows enough about OFBiz to do the interviews.', '2008-09-03 16:06:20', '2008-09-03 16:06:19', '2008-09-03 16:06:20', '2008-09-03 16:06:19');
INSERT INTO `electronic_text` VALUES ('BLG10010', 'Considering how much more valuable ERP software is than operating system, lets crown David Jones OSS king of the hill and milk it for all it is worth.', '2008-09-03 16:06:20', '2008-09-03 16:06:19', '2008-09-03 16:06:20', '2008-09-03 16:06:19');
