INSERT INTO `electronic_text` VALUES ('pbody5', '<head>\r\n		<meta http-equiv=\"Content-Type\" content=\"text/html; charset=gb2312\">\r\n		<meta http-equiv=\"Expires\" content=\"0\">\r\n		<meta http-equiv=\"html\" content=\"no-cache\">\r\n		<meta http-equiv=\"Pragma\" content=\"no-cache\">\r\n		<meta http-equiv=\"MSThemeCompatible\" content=\"Yes\">\r\n		<meta name=\"MSSmartTagsPreventParsing\" content=\"TRUE\">\r\n		<meta name=\"vs_targetSchema\" content=\"http://schemas.microsoft.com/intellisense/ie5\">\r\n		<link href=\"/favicon.ico\" rel=\"shortcut icon\" />\r\n		<link href=\"/favicon.ico\" rel=\"bookmark\" />\r\n		<link href=\"/siteview/css/SiteView.css\" rel=\"stylesheet\" rev=\"stylesheet\" type=\"text/css\" />\r\n</head>\r\n<body>\r\n<div class=\"mframe\">\r\n	<table align=\"center\" id=\"_ctl0_ParentDataList\" cellspacing=\"0\" border=\"0\" width=\"476\" ;border-collapse:collapse;\">\r\n		<tr>\r\n			<td style=\"width:25%;\">\r\n\r\n						<div style=\"verticle-align:top;height:100%\">\r\n\r\n						  <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n						   <tr>\r\n							<td class=\"tl\"></td>\r\n							<td class=\"ttitle\">\r\n\r\n							<table class=\"\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n							 <tr>\r\n							   <td class=\"ttitle\">\r\n								<span><A name=\"bookmark1211\">IT部门该如何提高服务管理水平</A></span></td>\r\n								</tr>\r\n							</table>\r\n\r\n							</td>\r\n						<td class=\"tr\"></td>\r\n						</tr>\r\n						</table>\r\n\r\n						<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"border:1px solid #cccccc;\">\r\n						<tr>\r\n						<td colspan=\"2\" height=\"10\"></td>\r\n						</tr>\r\n						<tr width=\"100%\">\r\n						 <td width=\"6\" rowspan=\"2\" valign=\"top\">\r\n\r\n							<table width=\"90%\">\r\n							<tr>\r\n							<td></td>\r\n							</tr>\r\n							</table>\r\n\r\n						</td>\r\n						<td>\r\n\r\n							 <table width=\"95%\" border=\"0\" align=\"center\">\r\n							   <tr>\r\n								<td>\r\n								  <div class=\"lh\"><p><br /><font color=\"#5a81a5\"><strong>资产管理<br /></strong>&nbsp;&nbsp;&nbsp; 高效管理IT资产生命周期，帮助您对管辖范围内的网络设备、服务器以及与其相关的备品备件信息进行统一维护管理，不断降低IT成本。</font></p>\r\n<p><font color=\"#5a81a5\"><strong>配置管理</strong><br />&nbsp;&nbsp;&nbsp; IT能力与业务需求保持一致，提供系统配置信息库功能，帮助您对配置、配置信息进行整体备份和恢复，对配置信息进行局部变更，对系统设置进行管理。<br /><br /><strong>知识库管理</strong><br />&nbsp;&nbsp;&nbsp; 实现知识共享，记录并保存故障处理信息，形成故障处理的专家知识库，方便您对维修记录进行察看和编</font><font color=\"#5a81a5\">辑，快速地寻找到解决方案。</font></p>\r\n<p><font color=\"#5a81a5\"><strong>故障管理</strong><br />&nbsp;&nbsp;&nbsp; 避免故障的无限升级和解决迟缓问题，通过阀值和连续故障长度设定故障规则，为一个或多个设备设定事件规则，为每个事件规则设定计划任务。</font></p>\r\n<p><strong>运行考核<br /></strong>&nbsp;&nbsp;&nbsp; 实现IT部门工作量化，以事件为依据，客观反应系统运行情况，考核运维人员的忙碌状态和实际工作效，为您提供自定义报表和指标统计。</p>　\r\n								  </div>\r\n								</td>\r\n								</tr>\r\n							 </table>\r\n						</td>\r\n																						\r\n						</tr>\r\n																					\r\n						<tr>\r\n						  <td class=\"mm\">\r\n						  <table width=\"95%\" border=\"0\" align=\"center\">\r\n							<tr>\r\n							 <td>\r\n							 </td>\r\n							</tr>\r\n						  </table>\r\n						 </td>\r\n						<td></td>\r\n						 </tr>\r\n																					\r\n						<tr>\r\n						<td colspan=\"2\" height=\"10\"></td>\r\n						</tr>\r\n						</table>\r\n						\r\n						<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n						<tr>\r\n						<td class=\"bl\"></td>\r\n						<td class=\"bm\">&nbsp;</td>\r\n						<td class=\"br\"></td>\r\n						</tr>\r\n						</table>\r\n						</div>\r\n						</td>\r\n					</tr>\r\n					</table>\r\n					</div>\r\n					</body>', '2008-09-16 09:48:44', '2008-09-16 09:48:43', '2008-09-16 09:48:44', '2008-09-16 09:48:43');
INSERT INTO `electronic_text` VALUES ('pbody6', '<head>\r\n		<meta http-equiv=\"Content-Type\" content=\"text/html; charset=gb2312\">\r\n		<meta http-equiv=\"Expires\" content=\"0\">\r\n		<meta http-equiv=\"html\" content=\"no-cache\">\r\n		<meta http-equiv=\"Pragma\" content=\"no-cache\">\r\n		<meta http-equiv=\"MSThemeCompatible\" content=\"Yes\">\r\n		<meta name=\"MSSmartTagsPreventParsing\" content=\"TRUE\">\r\n		<meta name=\"vs_targetSchema\" content=\"http://schemas.microsoft.com/intellisense/ie5\">\r\n		<link href=\"/favicon.ico\" rel=\"shortcut icon\" />\r\n		<link href=\"/favicon.ico\" rel=\"bookmark\" />\r\n		<link href=\"/siteview/css/SiteView.css\" rel=\"stylesheet\" rev=\"stylesheet\" type=\"text/css\" />\r\n</head>\r\n<body>\r\n<div class=\"mframe\">\r\n    <table align=\"center\" id=\"_ctl0_ParentDataList\" cellspacing=\"0\" border=\"0\" width=\"476\" ;border-collapse:collapse;\">\r\n	<tr>\r\n		<td style=\"width:25%;\">\r\n                                       <div style=\"verticle-align:top;height:100%\">\r\n                                           <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n			   <tr>\r\n				<td class=\"tl\"></td>\r\n				<td class=\"ttitle\">\r\n                                                                    <table class=\"\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n					 <tr>\r\n						   <td class=\"ttitle\">\r\n							<span><A name=\"bookmark1210\">为什么选择SiteView系列产品？</A></span>\r\n                                                                                                   </td>\r\n					</tr>\r\n				    </table>\r\n                                                                </td>\r\n				<td class=\"tr\"></td>\r\n			</tr>\r\n		    </table>\r\n                                    <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"border:1px solid #cccccc;\">\r\n			<tr>\r\n				<td colspan=\"2\" height=\"10\"></td>\r\n			</tr>\r\n			<tr width=\"100%\">\r\n				<td width=\"6\" rowspan=\"2\" valign=\"top\">\r\n                                                                    <table width=\"90%\">\r\n					<tr>\r\n						<td></td>\r\n					</tr>\r\n				    </table>\r\n\r\n				</td>\r\n				<td>\r\n                                                                    <table width=\"95%\" border=\"0\" align=\"center\">\r\n					  <tr>\r\n						<td>\r\n							 <div class=\"lh\"><p>\r\n<table id=\"_ctl0_DataList3__ctl1_DataList2\" style=\"WIDTH: 100%; BORDER-COLLAPSE: collapse\" cellspacing=\"0\" cellpadding=\"2\" border=\"0\">\r\n    <tbody>\r\n        <tr>\r\n            <td style=\"WIDTH: 100%\"><span class=\"ttitle2\">\r\n            <div class=\"lh\">SiteView是成熟的IT运维产品 </div>\r\n            <!--</a>--></span><span class=\"mm\">&nbsp;&nbsp;\r\n            <div class=\"lh\">&nbsp;&nbsp;&nbsp;&nbsp;SiteView系列产品经由游龙科技七年开发，适用于各种规模的网络，成功应用于电信、电力、银行证券、政府、石油石化、教育科研、交通等各个行业。 </div>\r\n            </span><!--/a-->\r\n            <table width=\"100%\" border=\"0\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td>&nbsp;</td>\r\n                        <td>&nbsp;</td>\r\n                        <td>&nbsp;</td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"WIDTH: 100%\"><!--a href=\"/Index/Catalog602V/600S/101.aspx\"--><span class=\"ttitle2\"><!--<a href=\"/Index/Catalog602V/600S/100.aspx\">-->\r\n            <div class=\"lh\">SiteView性能卓越 </div>\r\n            <!--</a>--></span><span class=\"mm\">&nbsp;&nbsp;\r\n            <div class=\"lh\">&nbsp;&nbsp;&nbsp;&nbsp;SiteView采用B/S架构，具有极高的应用性、协同性和可扩展性，先后多次获得&ldquo;企业认可品牌奖&rdquo;、&ldquo;网管员最喜爱的网管系统&rdquo;等殊荣。 </div>\r\n            </span><!--/a-->\r\n            <table width=\"100%\" border=\"0\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td>&nbsp;</td>\r\n                        <td>&nbsp;</td>\r\n                        <td>&nbsp;</td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"WIDTH: 100%\"><!--a href=\"/Index/Catalog603V/600S/101.aspx\"--><span class=\"ttitle2\"><!--<a href=\"/Index/Catalog603V/600S/100.aspx\">-->\r\n            <div class=\"lh\">SiteView 始终致力于技术创新 </div>\r\n            <!--</a>--></span><span class=\"mm\">&nbsp;&nbsp;\r\n            <div class=\"lh\">&nbsp;&nbsp;&nbsp;&nbsp;作为技术驱动型公司，游龙科技专门在美国波士顿和中国长沙成立研发中心，不断发展完善SiteView系列产品。 </div>\r\n            </span><!--/a-->\r\n            <table width=\"100%\" border=\"0\">\r\n                <tbody>\r\n                    <tr>\r\n                        <td>&nbsp;</td>\r\n                        <td>&nbsp;</td>\r\n                        <td>&nbsp;</td>\r\n                    </tr>\r\n                </tbody>\r\n            </table>\r\n            </td>\r\n        </tr>\r\n        <tr>\r\n            <td style=\"WIDTH: 100%\"><!--a href=\"/Index/Catalog604V/600S/101.aspx\"--><span class=\"ttitle2\"><!--<a href=\"/Index/Catalog604V/600S/100.aspx\">-->\r\n            <div class=\"lh\">SiteView 产品的行销、售后服务遍布全国 </div>\r\n            <!--</a>--></span><span class=\"mm\">&nbsp;&nbsp;\r\n            <div class=\"lh\">&nbsp;&nbsp;&nbsp;&nbsp;游龙科技总部在北京，现已在上海、广州、浙江、湖南、重庆、山东、江苏、福建等设立了办事处，在全国20几个主要省、市设有分支机构。</div>\r\n            </span></td>\r\n        </tr>\r\n    </tbody>\r\n</table>\r\n</p>　\r\n							  </div>\r\n							</td>\r\n						</tr>\r\n					    </table>\r\n					</td>\r\n				</tr>											<tr>\r\n					  <td class=\"mm\">\r\n						  <table width=\"95%\" border=\"0\" align=\"center\">\r\n							<tr>\r\n							 <td>\r\n							 </td>\r\n							</tr>\r\n						  </table>\r\n					 </td>\r\n					<td></td>\r\n				 </tr>																\r\n				<tr>\r\n					<td colspan=\"2\" height=\"10\"></td>\r\n				</tr>\r\n			    </table>\r\n						\r\n			    <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n				<tr>\r\n					<td class=\"bl\"></td>\r\n					<td class=\"bm\">&nbsp;</td>\r\n					<td class=\"br\"></td>\r\n				</tr>\r\n			    </table>\r\n			</div>\r\n		</td>\r\n	</tr>	\r\n </table>', '2008-09-16 09:56:33', '2008-09-16 09:56:32', '2008-09-16 09:56:33', '2008-09-16 09:56:32');
INSERT INTO `electronic_text` VALUES ('RELATED_1', '\nAl Byers in this marvelous display of technical manual writing has show the way for us all to reach for the stars.\n        ', '2008-09-03 16:05:57', '2008-09-03 16:05:57', '2008-09-03 16:05:57', '2008-09-03 16:05:57');
INSERT INTO `electronic_text` VALUES ('RELATED_2', '\nThis poor attempt at a maintenance document is so flawed that I don\'t know where to begin.\nFor instance, he never mentions the need for all spectators to wear hardhats.\nI wonder how Al Byers sleeps a night knowing that because of his negligence someone,\neven someone that he loves, could be terminated by a reentrant space vehicle.\n        ', '2008-09-03 16:05:57', '2008-09-03 16:05:57', '2008-09-03 16:05:57', '2008-09-03 16:05:57');
INSERT INTO `electronic_text` VALUES ('RELATED_3', '\nWhile truly visionary, one has to ask the question why are the national defense aspects of this futuristic\ntechnology mentioned?\nSurely no one can overlook the possibilities for making this nation and the world a safer place.\nThere is no reason why every community could not have a battery of these stations - if not in a fixed location, at least on a mobile launcher that could be hooked up to an SUV and towed from one driveway to another on a random schedule.\n        ', '2008-09-03 16:05:57', '2008-09-03 16:05:57', '2008-09-03 16:05:57', '2008-09-03 16:05:57');
INSERT INTO `electronic_text` VALUES ('RELATED_4', '\nShame on Al Byers.\nWhen is enough enough?\nJust how many scrapbooks not being done for lack of construction paper does it take for him to\nget the idea that there are more important things in life than shooting for the stars.\n        ', '2008-09-03 16:05:57', '2008-09-03 16:05:57', '2008-09-03 16:05:57', '2008-09-03 16:05:57');
