\n    </#if>\r\n    ${(thisContent.subcontent.SiteViewBodyFoot)?if_exists}\r\n  </body>\r\n</html>', '2008-10-09 14:57:15', '2008-10-09 14:57:15', '2008-09-04 14:16:50', '2008-09-04 14:16:44');
INSERT INTO `electronic_text` VALUES ('STDWRAP001', '<#assign mapKey=wrapMapKey?if_exists/>\n<#assign subDataResourceId=wrapDataResourceId?if_exists/>\n<#assign subDataResourceTypeId=wrapDataResourceTypeId?if_exists/>\n<#assign contentIdTo=wrapContentIdTo?if_exists/>\n<#assign mimeTypeId=wrapMimeTypeId?if_exists/>\n<#assign subContentId=wrapSubContentId?if_exists/>\n<div id=\"divTwo\" class=\"wrapOuter\">\n    <div class=\"tabletext\">\n    ${mapKey?if_exists}\n    <a class=\"buttontext\" href=\"javascript:lookupSubContent(\'<@ofbizUrl>/LookupSubContent</@ofbizUrl>\', \'${contentIdTo?if_exists}\',\'${mapKey?if_exists}\',  \'${subDataResourceTypeId?if_exists}\', \'${mimeTypeId?if_exists}\')\"\n>[Find]</a>\n    <#assign ofbizRequest=\"\"/>\n    <#assign httpParams=\"contentIdTo=\" + contentIdTo?if_exists + \"&mapKey=\" + mapKey?if_exists />\n    <#if subDataResourceTypeId == \"IMAGE_OBJECT\">\n        <#assign ofbizRequest=\"EditLayoutImage\"/>\n    <#else>\n        <#if subDataResourceTypeId == \"URL_RESOURCE\">\n            <#assign ofbizRequest=\"EditLayoutUrl\"/>\n        <#else>\n            <#assign ofbizRequest=\"EditLayoutSubContent\"/>\n        </#if>\n    </#if>\n    <a class=\"buttontext\" href=\"<@ofbizUrl>/${ofbizRequest}?${httpParams}&mode=add</@ofbizUrl>\">[New]</a>\n    <#if subContentId?exists && (0 < subContentId?length)>\n        <a class=\"buttontext\" href=\"<@ofbizUrl>/${ofbizRequest}?${httpParams}&contentId=${subContentId}&drData\nResourceId=${subDataResourceId?if_exists}</@ofbizUrl>\">[Edit]</a>\n    </#if>\n    </div>\n<div id=\"divOne\" class=\"wrapInner\">\n<@renderWrappedText/>\n</div>\n</div>', '2008-09-03 16:05:09', '2008-09-03 16:05:09', '2008-09-03 16:05:08', '2008-09-03 16:05:07');
INSERT INTO `electronic_text` VALUES ('STORE_POLICIES', '\n            <div class=\"head2\">Store Policies</div>\n            <div class=\"tabletext\">This is just a demo store, so you might not really like our policies. Here there are any way:</div>\n            <div class=\"tabletext\">\n                <ol>\n                    <li>If you send us money we\'ll keep it. So DON\'T SEND US MONEY!</li>\n                    <li>We will never fulfill anything you order here. In fact, we haven\'t even bothered to create any of these products. They are all just made up.</li>\n                    <li>It might surprise you, but this <bold>is</bold> a for-profit store. We make money by selling you\'re contact information. You\'d be surprised by how many suckers put in real personal data! We make tons on it! (NOT!) Don\'t worry, this is just a joke. If you\'ve entered anything it\'s safe with us...</li>\n                </ol>\n            </div>\n        ', '2008-09-03 16:05:50', '2008-09-03 16:05:50', '2008-09-03 16:05:50', '2008-09-03 16:05:50');
INSERT INTO `electronic_text` VALUES ('STORE_POLICIES2', '\n            <div class=\"tabletext\">These next policies are meaningless, and are really just used to demonstrate having 2 content sections on the page:</div>\n            <div class=\"tabletext\">\n                <ol>\n                    <li>Item 1</li>\n                    <li>Item 2</li>\n                    <li>Item 3</li>\n                </ol>\n            </div>\n        ', '2008-09-03 16:05:50', '2008-09-03 16:05:50', '2008-09-03 16:05:50', '2008-09-03 16:05:50');
