INSERT INTO `electronic_text` VALUES ('svclientvoice', '<#assign uiLabelMap= Static[\"com.siteview.web.util.Tools\"].getResourceBundle(request,\"SiteViewClientVoice\")/>\r\n <div class=\"lframe\">\r\n    <table vAlign=\"top\" width=\'140\' style=\"padding-left:10px;padding-top:5px\" align=\'center\'>\r\n       <tr>\r\n        <td>\r\n<table id=\"navbar\" width=\'100%\' align=\"center\" cellpadding=\"0\" cellspacing=\"0\">  \r\n     <tr>\r\n           <td>\r\n	<table class=\"twrw\" width=\'100%\' style=\"BORDER-RIGHT: #98b1c4 1px solid; BORDER-TOP: #98b1c4 1px solid; BORDER-LEFT: #98b1c4 1px solid; BORDER-BOTTOM: #98b1c4 1px solid\" cellSpacing=\"0\" cellPadding=\"0\" id=\"table4\">\r\n		<tr>\r\n			<td class=\"tl\">　</td>\r\n			<td class=\"tm\"><span class=\"tt\">${uiLabelMap.get(\"svClient\")?if_exists}</span> </td>\r\n			<td class=\"tr\">　</td>\r\n		</tr>\r\n	</table>\r\n	<table width=\'100%\' style=\"BORDER-RIGHT: #cccccc 1px solid; BORDER-TOP: #cccccc 1px solid; BORDER-LEFT: #cccccc 1px solid; BORDER-BOTTOM: #cccccc 1px solid\" cellSpacing=\"0\" cellPadding=\"0\">\r\n		<tr>\r\n			<td class=\"mm2\">\r\n		<SCRIPT language=JavaScript>\r\n													<!-- Begin\r\n		var qiksearch_js_text = new Array (\r\n	   \"<p style=\'line-height: 20px;\' class=\'tdbg_left\'><font color=\'#5C81A7\'></font>${uiLabelMap.get(\"svLine1\")?if_exists}<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;${uiLabelMap.get(\"svWord1\")?if_exists}\",\r\n	   \"<p style=\'line-height: 20px;\' class=\'tdbg_left\'><font color=\'#5C81A7\'></font>${uiLabelMap.get(\"svLine2\")?if_exists}<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;---21CN.com\", \r\n	   \"<p style=\'line-height: 20px;\' class=\'tdbg_left\'><font color=\'#000066\'></font>${uiLabelMap.get(\"svLine3\")?if_exists}<br>&nbsp;&nbsp;${uiLabelMap.get(\"svWord2\")?if_exists}\",\r\n	   \"<p style=\'line-height: 20px;\' class=\'tdbg_left\'><font color=\'#000066\'></font>${uiLabelMap.get(\"svLine4\")?if_exists}<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;---263 IDC\",\r\n	 \"<p style=\'line-height: 20px;\' class=\'tdbg_left\'><font color=\'#000066\'></font>${uiLabelMap.get(\"svLine5\")?if_exists}<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;${uiLabelMap.get(\"svWord3\")?if_exists}\",\r\n	      \"<p style=\'line-height: 20px;\' class=\'tdbg_left\'><font color=\'#000066\'></font>${uiLabelMap.get(\"svLine6\")?if_exists}<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;${uiLabelMap.get(\"svWord4\")?if_exists}\",\r\n	   \"<p style=\'line-height: 20px;\' class=\'tdbg_left\'><font color=\'#000066\'></font>${uiLabelMap.get(\"svLine7\")?if_exists}<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;${uiLabelMap.get(\"svWord5\")?if_exists}\",\r\n	 \"<p style=\'line-height: 20px;\' class=\'tdbg_left\'><font color=\'#000066\'></font>${uiLabelMap.get(\"svLine8\")?if_exists}<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;${uiLabelMap.get(\"svWord6\")?if_exists}\"\r\n				   );\r\n				var qiksearch_space_width = 138; // The width of the content space\r\n				var qiksearch_space_height = 100; // The height of the content space\r\n				var qiksearch_space_borderw=0; // Border width\r\n				var qiksearch_space_borderc=\"#ffffff\"; // Border Color\r\n				var timeOutVal=300; // Delay in milliseconds\r\n				\r\n				\r\n				//--------------------------------------------------------------------------------------------\r\n				\r\n				//-----------------------------DO-NOT-MODIFY-BELOW-THIS---------------------------------------\r\n				\r\n				document.write(\'<table width=\"\' + qiksearch_space_width + \'\" height=\"\' + qiksearch_space_height + \'\" style=\"background:#ffffff; border:\' + qiksearch_space_borderw + \' solid \' + qiksearch_space_borderc + \'\"><tr><td align=\"left\" valign=\"top\">\');\r\n				document.write(\'<div id=\"qiksearch_js_space\">\');\r\n				document.write(\'</div>\');\r\n				document.write(\'</td></tr></table>\');\r\n				\r\n				var def_10=\'A\',def_11=\'B\',def_12=\'C\',def_13=\'D\',def_14=\'E\',def_15=\'F\';\r\n				var colorVal=15;\r\n				var div_count=0;\r\n				\r\n				function qiksearch_fade_desat(getColorIntVal)\r\n				{\r\n				 var returnVal;\r\n				 if(getColorIntVal>=10)\r\n				 {\r\n				  for(var i=0; i<=15; i++)\r\n				  {\r\n				   if((getColorIntVal==i))\r\n				   {\r\n				    returnVal = eval(\'def_\' + i);\r\n				   }\r\n				  }\r\n				 }\r\n				 else\r\n				 {\r\n				  returnVal=getColorIntVal;\r\n				 }\r\n				 return(returnVal);\r\n				} \r\n				\r\n				function writeDiv()\r\n				{\r\n				 document.all.qiksearch_js_space.innerHTML= \'<font face=\"verdana,arial,helvetica\" size=\"-1\" color=\"\' +  joinColor(qiksearch_fade_desat(colorVal)) + \'\">\' + qiksearch_js_text[div_count] + \'</span></font>\' ;\r\n				\r\n				 if((colorVal>0)  && (colorVal!=0))\r\n				 {\r\n				  colorVal--;\r\n				 }\r\n				 else\r\n				 {\r\n				  colorVal=15;\r\n				  if(div_count<qiksearch_js_text.length)\r\n				  {\r\n				   div_count++;\r\n				  }\r\n				  if(div_count==qiksearch_js_text.length)\r\n				  {\r\n				    resetAll()\r\n				  }\r\n				 }\r\n				\r\n				 if(div_count<qiksearch_js_text.length)\r\n				 {\r\n				  setTimeout(\"writeDiv()\",timeOutVal);\r\n				 }\r\n				}\r\n				\r\n				function joinColor(getColor)\r\n				{\r\n				 return (getColor + \'0\' + getColor + \'0\' + getColor + \'0\');\r\n				}\r\n				\r\n				function resetAll()\r\n				{\r\n				 div_count=0;\r\n				 colorVal=15;\r\n				}\r\n				\r\n				writeDiv();\r\n				//  End -->\r\n                                 </SCRIPT>\r\n						</td>\r\n					</tr>\r\n				</table>\r\n				                             </td>\r\n		       </tr>\r\n	    </table>\r\n        </td>\r\n    </tr>\r\n</table>\r\n</div>\r\n			', '2008-10-08 14:21:36', '2008-10-08 14:21:36', '2008-09-10 16:30:20', '2008-09-10 16:30:19');
