INSERT INTO `electronic_text` VALUES ('svgoverment', '<table width=\"100%\"  border=\"0\" cellspacing=\"0\" cellpadding=\"0\">\r\n        <tr>\r\n        <td class=\"blue\" width=124 height=31>政 府 行 业</td>\r\n        <td width=\"506\" class=\"dot\">&nbsp;</td>\r\n     </tr>\r\n     <tr>\r\n       <td colspan=\"2\">\r\n	   \r\n	   <table width=\"100%\"  border=\"0\" cellspacing=\"0\" cellpadding=\"0\" bgcolor=\"#FFFFFF\">\r\n  <tr>\r\n    <td width=\"51%\"><img src=\"/content/control/ViewSimpleContent?dataResourceId=svs1[1]zh\"></td>\r\n    <td width=\"49%\" valign=\"top\"><table width=\"100%\"  border=\"0\" cellspacing=\"0\" cellpadding=\"0\" bgcolor=\"#FFFFFF\">\r\n  <tr>\r\n    <td class=\"content\"><h3 align=\"center\" class=\"style2\">政府行业需重视桌面管理</h3>&nbsp;&nbsp;&nbsp;&nbsp;<a href=\"http://www.siteview.com/cms/html/chanpinzilanmu/2007/0925/1418.html\">政府是国家重要行政单位，政府的稳定是国家稳定的根本保障。随着信息化建设的深入发展，政府部门内部，政府部门之间，政府部门与公众，政府部门与企业等的沟通越来越紧密......</a><br><br><br>\r\n      &nbsp;&nbsp;<a href=\"http://systemmarket.digitalchina.com/zf-hydt-2034.html\">2034亿政府采购大餐的吃法(来自：增值IT联盟)</a><br>\r\n     &nbsp;&nbsp;<a href=\"http://www.zhengzhou.gov.cn/html/012402/070614170034.html\">政府行业局域网解决方案(来自：郑州市人民政府网)</a><br>\r\n             \r\n      </td>\r\n  </tr>\r\n</table>\r\n\r\n\r\n</td>\r\n\r\n  </tr>\r\n</table>', '2008-10-07 10:36:25', '2008-10-07 10:36:25', '2008-10-07 10:34:15', '2008-10-07 10:34:15');
