INSERT INTO `electronic_text` VALUES ('svpbody2', '<table id=\"navbar\" width=\"476\"  align=\"center\" cellpadding=\"0\" cellspacing=\"0\">\r\n  <tr>\r\n    <td vAlign=\"top\" style=\"padding-top:5\">\r\n      <div class=\"mframe\">\r\n         <table id=\"_ctl0_DataList4\" cellspacing=\"0\" border=\"0\" style=\"width:100%;border-collapse:collapse;\">\r\n           <tr>\r\n             <td style=\"width:25%;\">\r\n               <div style=\"verticle-align:top;height:100%\">\r\n                 <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\"  style=\"border:1px solid #cccccc;\">\r\n                   <tr>\r\n                       <td class=\"tl\"></td>\r\n                       <td>\r\n                          <table width=\"93%\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\" align=\"center\">\r\n                            <tr>\r\n                              <td><div class=\"lh\">\r\n                                  <span>&nbsp;&nbsp;&nbsp;&nbsp;<div class=\"lh\">\r\n                                  <span><P>&nbsp;&nbsp;&nbsp;&nbsp;通过七年来的跟踪调查和分析，游龙科技认为国内IT运维部门80％日常繁杂的运维工作可以用自动化、流程化、标准化的IT运维工具来替代。经过悉心研究，游龙科技根据IT运维人员日常工作中的几个主要方向，陆续推出SiteView系列产品。</P>\r\n                                       <P>&nbsp;&nbsp;<A href=\"##\" target=_blank><IMG src=\"/content/control/ViewSimpleContent?dataResourceId=svcpxx${Static[\"com.siteview.web.util.Tools\"].getLocale(locale)}\"  border=0 target=\"_blank\"></A></P>\r\n                                  </span>\r\n                                  </div>\r\n                                  </span></div>\r\n                             </td>\r\n                            </tr>\r\n                          </table>\r\n                       </td>\r\n                       <td class=\"tr\"></td>\r\n                    </tr>\r\n                 </table>\r\n                </div>\r\n             </td>\r\n          </tr>\r\n         </table>\r\n       </div>\r\n      </td>\r\n  </tr>\r\n</table>\r\n', '2008