INSERT INTO `electronic_text` VALUES ('svpbody5', '<div class=\"mframe\">\r\n    <table align=\"center\" id=\"_ctl0_ParentDataList\" cellspacing=\"0\" border=\"0\" width=\"476\" ;border-collapse:collapse;\">\r\n	<tr>\r\n		<td style=\"width:25%;\">\r\n                                               <div style=\"verticle-align:top;height:100%\">\r\n                                                   <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n				   <tr>\r\n					<td class=\"tl\"></td>\r\n					<td class=\"ttitle\">\r\n                                                                                     <table class=\"\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n						 <tr>\r\n							   <td class=\"ttitle\">\r\n								<span><A name=\"bookmark1211\">IT部门该如何提高服务管理水平</A></span></td>\r\n						</tr>\r\n					    </table>\r\n\r\n					</td>\r\n					<td class=\"tr\"></td>\r\n				   </tr>\r\n			    </table>\r\n                                                    <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"border:1px solid #cccccc;\">\r\n				<tr>\r\n					<td colspan=\"2\" height=\"10\"></td>\r\n				</tr>\r\n				<tr width=\"100%\">\r\n					 <td width=\"6\" rowspan=\"2\" valign=\"top\">\r\n	                                                                      <table width=\"90%\">\r\n						<tr>\r\n							<td></td>\r\n						</tr>\r\n					     </table>\r\n                                                                                </td>\r\n					<td>\r\n                                                                                    <table width=\"95%\" border=\"0\" align=\"center\">\r\n						  <tr>\r\n							<td>\r\n							  <div class=\"lh\"><p><br /><font color=\"#5a81a5\"><strong>资产管理<br /></strong>&nbsp;&nbsp;&nbsp; 高效管理IT资产生命周期，帮助您对管辖范围内的网络设备、服务器以及与其相关的备品备件信息进行统一维护管理，不断降低IT成本。</font></p>\r\n<p><font color=\"#5a81a5\"><strong>配置管理</strong><br />&nbsp;&nbsp;&nbsp; IT能力与业务需求保持一致，提供系统配置信息库功能，帮助您对配置、配置信息进行整体备份和恢复，对配置信息进行局部变更，对系统设置进行管理。<br /><br /><strong>知识库管理</strong><br />&nbsp;&nbsp;&nbsp; 实现知识共享，记录并保存故障处理信息，形成故障处理的专家知识库，方便您对维修记录进行察看和编</font><font color=\"#5a81a5\">辑，快速地寻找到解决方案。</font></p>\r\n<p><font color=\"#5a81a5\"><strong>故障管理</strong><br />&nbsp;&nbsp;&nbsp; 避免故障的无限升级和解决迟缓问题，通过阀值和连续故障长度设定故障规则，为一个或多个设备设定事件规则，为每个事件规则设定计划任务。</font></p>\r\n<p><strong>运行考核<br /></strong>&nbsp;&nbsp;&nbsp; 实现IT部门工作量化，以事件为依据，客观反应系统运行情况，考核运维人员的忙碌状态和实际工作效，为您提供自定义报表和指标统计。</p>　\r\n							     </div>\r\n							   </td>\r\n						    </tr>\r\n					    </table>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					  <td class=\"mm\">\r\n					     <table width=\"95%\" border=\"0\" align=\"center\">\r\n						<tr>\r\n							 <td>\r\n							 </td>\r\n						</tr>\r\n					     </table>\r\n					</td>\r\n					<td></td>\r\n				 </tr>\r\n				<tr>\r\n					<td colspan=\"2\" height=\"10\"></td>\r\n				</tr>\r\n			</table>\r\n						\r\n			<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n				 <tr>\r\n					<td class=\"bl\"></td>\r\n					<td class=\"bm\">&nbsp;</td>\r\n					<td class=\"br\"></td>\r\n				</tr>\r\n		               </table>\r\n		         </div>\r\n		</td>\r\n	</tr>\r\n    </table>\r\n</div>\r\n', '2008-09-11 09:34:04', '2008-09-11 09:34:03', '2008-09-11 09:33:32', '2008-09-11 09:33:32');
