INSERT INTO `electronic_text` VALUES ('svrbody2', '<div class=\"mframe\">\r\n    <table align=\"center\" id=\"id=\"_ctl0_DataList3\" \" cellspacing=\"0\" border=\"0\" width=\"476\" ;border-collapse:collapse;\">\r\n	<tr>\r\n		<td style=\"width:25%;\">\r\n			<div style=\"verticle-align:top;height:100%\">\r\n			     <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n				 <tr>\r\n					<td class=\"tl\"></td>\r\n					<td class=\"ttitle\">\r\n                                                                                    <table class=\"\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n						 <tr>\r\n							   <td class=\"ttitle\">\r\n							<span><A name=\"bookmark1173\">方案概述</A></span></td>\r\n						 </tr>\r\n					     </table>\r\n                                                                                  </td>\r\n					  <td class=\"tr\"></td>\r\n				  </tr>\r\n			       </table>\r\n\r\n			      <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"border:1px solid #cccccc;\">\r\n				<tr>\r\n					<td colspan=\"2\" height=\"10\"></td>\r\n				</tr>\r\n				<tr width=\"100%\">\r\n					 <td width=\"6\" rowspan=\"2\" valign=\"top\">\r\n                                                                                      <table width=\"90%\">\r\n						<tr>\r\n							<td></td>\r\n						</tr>\r\n					     </table>\r\n\r\n					</td>\r\n					<td>\r\n                                                                                     <table width=\"95%\" border=\"0\" align=\"center\">\r\n						  <tr>\r\n							<td>\r\n								  <div class=\"lh\"><font color=\"#5a81a5\">&nbsp;&nbsp;&nbsp; 如今，许多大型企业的规模和业务量都在急剧扩大，对IT部门的要求也越来越高，已经不满足于仅仅对系统故障的处理了，而是要求IT部门能为企业的发展做出贡献，提高对IT部门的投资回报率。<br /><br />&nbsp;&nbsp;&nbsp; 面对如此高的要求和压力，IT部门就需要有一套规范、可管理的IT服务流程，有效地管理IT组织、使信息系统更加灵活的适应业务持续变化的需求、使IT部门从成本中心转变为利润中心。<br /><br />&nbsp;&nbsp;&nbsp; 作为企业的CIO，您是否正在被这样的问题和压力所困扰，苦于没有好的解决方案而发愁呢？<br /><br />&nbsp;&nbsp;&nbsp; 游龙科技作为网络管理软件的开发商和解决方案的提供商，多年来致力于ITSM领域的研究与开发，推出的SiteView ITSM可以为您排忧解难。它是一种在综合系统管理的基础上，最大限度提高IT部门服务质量和效率的解决方案。</font>　\r\n								  </div>\r\n							</td>\r\n						</tr>\r\n					     </table>\r\n					</td>										  </tr>											   <tr>\r\n					  <td class=\"mm\">\r\n					     <table width=\"95%\" border=\"0\" align=\"center\">\r\n						<tr>\r\n							 <td>\r\n							 </td>\r\n						</tr>\r\n					     </table>\r\n					  </td>\r\n					<td></td>\r\n				</tr>										<tr>\r\n						<td colspan=\"2\" height=\"10\"></td>\r\n					</tr>\r\n				</table>\r\n						\r\n				<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tr>\r\n						<td class=\"bl\"></td>\r\n						<td class=\"bm\">&nbsp;</td>\r\n						<td class=\"br\"></td>\r\n					</tr>\r\n				</table>\r\n			</div>\r\n		</td>				\r\n	</tr>\r\n    </table>\r\n</div>\r\n', '2008-09-16 14:38:02', '2008-09-16 14:38:01', '2008-09-16 14:37:32', '2008-09-16 14:37:31');
INSERT INTO `electronic_text` VALUES ('svrbody3', '<div class=\"mframe\">\r\n<table align=\"center\" id=\"id=\"_ctl0_DataList3\" \" cellspacing=\"0\" border=\"0\" width=\"476\" ;border-collapse:collapse;\">\r\n	<tr>\r\n		<td style=\"width:25%;\">\r\n		        <div style=\"verticle-align:top;height:100%\">\r\n			 <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n				 <tr>\r\n					<td class=\"tl\"></td>\r\n					<td class=\"ttitle\">\r\n					   <table class=\"\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n						<tr>\r\n							  <td class=\"ttitle\">\r\n								<span><A name=\"bookmark1164\">方案构成</A></span>\r\n							</td>\r\n						</tr>\r\n					    </table>\r\n                                                                                  </td>\r\n					  <td class=\"tr\"></td>\r\n				</tr>\r\n		                 </table>\r\n\r\n			 <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"border:1px solid #cccccc;\">\r\n				<tr>\r\n					<td colspan=\"2\" height=\"10\"></td>\r\n				</tr>\r\n				<tr width=\"100%\">\r\n					 <td width=\"6\" rowspan=\"2\" valign=\"top\">\r\n					     <table width=\"90%\">\r\n						<tr>\r\n							<td></td>\r\n						</tr>\r\n					     </table>\r\n                                                                                  </td>\r\n					   <td>\r\n						 <table width=\"95%\" border=\"0\" align=\"center\">\r\n							   <tr>\r\n								<td>\r\n								 	 <div class=\"lh\">\r\n								  			<font color=\"#5a81a5\">&nbsp;&nbsp;&nbsp; SiteView ITSM是真正满足中国用户IT服务管理需求、符合中国用户使用习惯的<br />&nbsp;全方位解决方案，是中国用户真正用得起、用得好、用得久的IT服务管理软件。<br />\r\n											  <embed\r\n											   pluginspage=\"http://www.macromedia.com/go/getflashplayer\"\r\n											    src=\"/content/control/ViewSimpleContent?dataResourceId=svresolve\" width=\"450\" height=\"240\" \r\n											    type=\"application/x-shockwave-flash\" scale=\"\" play=\"\" loop=\"\" menu=\"\">\r\n											  </embed>&nbsp;<br />&nbsp;</font>　\r\n								           </div>\r\n							                   </td>\r\n						                      </tr>\r\n				                                      </table>\r\n				                      </td>																	\r\n			                 </tr>																			\r\n			                 <tr>\r\n				       <td class=\"mm\">\r\n					 <table width=\"95%\" border=\"0\" align=\"center\">\r\n						<tr>\r\n						 <td>\r\n						 </td>\r\n						</tr>\r\n					 </table>\r\n				            </td>\r\n				            <td></td>\r\n			                   </tr>															\r\n			                   <tr>\r\n				             <td colspan=\"2\" height=\"10\"></td>\r\n			                    </tr>\r\n		                    </table>\r\n						\r\n		                    <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n			           <tr>\r\n				       <td class=\"bl\"></td>\r\n				      <td class=\"bm\">&nbsp;</td>\r\n				       <td class=\"br\"></td>\r\n			         </tr>\r\n		                   </table>\r\n		   </div>\r\n	    </td>\r\n          </tr>\r\n</table>\r\n</div>\r\n', '2008-09-16 14:53:51', '2008-09-16 14:53:50', '2008-09-16 14:44:46', '2008-09-16 14:44:44');
INSERT INTO `electronic_text` VALUES ('svrbody4', '<div class=\"mframe\">\r\n<table align=\"center\" id=\"id=\"_ctl0_DataList3\" \" cellspacing=\"0\" border=\"0\" width=\"476\" ;border-collapse:collapse;\">\r\n	<tr>\r\n		<td style=\"width:25%;\">\r\n                                           <div style=\"verticle-align:top;height:100%\">\r\n                                                  <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n				   <tr>\r\n					<td class=\"tl\"></td>\r\n					<td class=\"ttitle\">\r\n                                                                                     <table class=\"\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n					             <tr>\r\n						   <td class=\"ttitle\">\r\n							<span><A name=\"bookmark1163\">客户获益</A></span></td>\r\n					              </tr>\r\n					     </table>\r\n\r\n					 </td>\r\n					  <td class=\"tr\"></td>\r\n				        </tr>\r\n			    </table>\r\n\r\n			<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"border:1px solid #cccccc;\">\r\n				<tr>\r\n					<td colspan=\"2\" height=\"10\"></td>\r\n				</tr>\r\n				<tr width=\"100%\">\r\n					 <td width=\"6\" rowspan=\"2\" valign=\"top\">\r\n                                                                                       <table width=\"90%\">\r\n						<tr>\r\n							<td></td>\r\n						</tr>\r\n					       </table>\r\n\r\n					</td>\r\n					<td>\r\n                                                                                      <table width=\"95%\" border=\"0\" align=\"center\">\r\n						 <tr>\r\n							<td>\r\n								  <div class=\"lh\"><p><font color=\"#5a81a5\"><strong>面向业务，优化服务：</strong><br /><strong>资产管理</strong>：能够在IT资产的整个生命周期内支持和管理，帮助各机构建立完整<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 的资产信息库、提高流程效 率并有效控制成本。<br /><br /><strong>配置变更</strong>：能够大幅度提高软件基础设施的灵活性 ，更好更快的是每个配置环<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 节保持一致，自动完成并且不易出错。<br /><br /><strong>流程优化</strong>：能够帮助IT部门在紧急和关键之间找到平衡，将有效资源科学配比<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 发挥最大效用，给服务关键环节添加润滑剂。<br /><br /><strong>知识共享</strong>：能够快速找出解决问题的头绪，面对种类繁多的设备、缤纷复杂的<br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 故障，不再寻根溯源无从下手。<br /></font><strong><br /><font color=\"#5a81a5\">商业价值：</font></strong><br /><font color=\"#5a81a5\">确保IT流程支撑业务流程，整体上提高了业务运营的质量。 <br />通过完善的服务体系，提高关键业务的连续可用性。<br />提高了客户和业务人员的生产 率。<br />提高了客户满意度。　<br />&nbsp;<br /><strong>经济价值：</strong><br />透明化控制、降低了IT资产的成本。<br />配置的统一化有效避免资源重复浪费。<br />关键业务的高可用性提高企业效益。<br />服务管理有效避免损失和浪费。<br /></font><strong><br /><font color=\"#5a81a5\">员工价值：</font></strong><br /><font color=\"#5a81a5\">合适的流程和相应的培训以确保员工不断积累经验。<br />提高IT部门的生产率。<br />提高了IT部门的工作满意度。 <br />使IT部门的价值得到更好的体现，从而提高了员工的工作积极性。</font></p>　\r\n								  </div>\r\n							</td>\r\n						</tr>\r\n					      </table>\r\n					</td>\r\n				</tr>\r\n				<tr>\r\n					  <td class=\"mm\">\r\n					       <table width=\"95%\" border=\"0\" align=\"center\">\r\n						<tr>\r\n							 <td>\r\n							 </td>\r\n						</tr>\r\n					         </table>\r\n					  </td>\r\n					   <td></td>\r\n				 </tr>									                                  <tr>\r\n					   <td colspan=\"2\" height=\"10\"></td>\r\n				 </tr>\r\n			</table>\r\n						\r\n			<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n				<tr>\r\n					<td class=\"bl\"></td>\r\n					<td class=\"bm\">&nbsp;</td>\r\n					<td class=\"br\"></td>\r\n				</tr>\r\n			</table>\r\n			</div>\r\n		</td>				\r\n	</tr>\r\n</table>\r\n</div>\r\n', '2008-09-16 15:00:06', '2008-09-16 15:00:05', '2008-09-16 14:59:24', '2008-09-16 14:59:22');
