r>\r\n					  <td class=\"mm\">\r\n					     <table width=\"95%\" border=\"0\" align=\"center\">\r\n						<tr>\r\n							 <td>\r\n							 </td>\r\n						</tr>\r\n					     </table>\r\n					  </td>\r\n					<td></td>\r\n				</tr>										<tr>\r\n						<td colspan=\"2\" height=\"10\"></td>\r\n					</tr>\r\n				</table>\r\n						\r\n				<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tr>\r\n						<td class=\"bl\"></td>\r\n						<td class=\"bm\">&nbsp;</td>\r\n						<td class=\"br\"></td>\r\n					</tr>\r\n				</table>\r\n			</div>\r\n		</td>				\r\n	</tr>\r\n    </table>\r\n</div>\r\n', '2008-09-17 09:37:16', '2008-09-17 09:37:15', '2008-09-17 09:37:16', '2008-09-17 09:37:15');
INSERT INTO `electronic_text` VALUES ('svsbody12', '<div class=\"mframe\">\r\n    <table align=\"center\" id=\"id=\"_ctl0_DataList3\" \" cellspacing=\"0\" border=\"0\" width=\"476\" ;border-collapse:collapse;\">\r\n	<tr>\r\n		<td style=\"width:25%;\">\r\n			<div style=\"verticle-align:top;height:100%\">\r\n			     <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n				 <tr>\r\n					<td class=\"tl\"></td>\r\n					<td class=\"ttitle\">\r\n                                                                                    <table class=\"\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n						 <tr>\r\n							   <td class=\"ttitle\">\r\n							<span><A name=\"bookmark1066\">广东电信集团</A></span></td>\r\n						 </tr>\r\n					     </table>\r\n                                                                                  </td>\r\n					  <td class=\"tr\"></td>\r\n				  </tr>\r\n			       </table>\r\n\r\n			      <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"border:1px solid #cccccc;\">\r\n				<tr>\r\n					<td colspan=\"2\" height=\"10\"></td>\r\n				</tr>\r\n				<tr width=\"100%\">\r\n					 <td width=\"6\" rowspan=\"2\" valign=\"top\">\r\n                                                                                      <table width=\"90%\">\r\n						<tr>\r\n							<td></td>\r\n						</tr>\r\n					     </table>\r\n\r\n					</td>\r\n					<td>\r\n                                                                                     <table width=\"95%\" border=\"0\" align=\"center\">\r\n						  <tr>\r\n							<td>\r\n								  <div class=\"lh\"> &nbsp;&nbsp;&nbsp;<a class=\"bb\" href=\"/cms/html/chenggonganli/anxingyefenlei/dianxin/2007/0420/1066.html\">    为进一步保持领先优势，保障基于网络的业务系统和工作环境高效、安全，广东省电信实业集团信息部门决定引进运维系统，加强对网络的管理。在仔细考察后，广东省电信实业集团决定签约游龙科技，引进SiteView解决方案。该方案，经游龙分析后，提供了系统管理软件和设备</a>								  </div>\r\n							</td>\r\n						</tr>\r\n					     </table>\r\n					</td>										  </tr>											   <tr>\r\n					  <td class=\"mm\">\r\n					     <table width=\"95%\" border=\"0\" align=\"center\">\r\n						<tr>\r\n							 <td>\r\n							 </td>\r\n						</tr>\r\n					     </table>\r\n					  </td>\r\n					<td></td>\r\n				</tr>										<tr>\r\n						<td colspan=\"2\" height=\"10\"></td>\r\n					</tr>\r\n				</table>\r\n						\r\n				<table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n					<tr>\r\n						<td class=\"bl\"></td>\r\n						<td class=\"bm\">&nbsp;</td>\r\n						<td class=\"br\"></td>\r\n					</tr>\r\n				</table>\r\n			</div>\r\n		</td>				\r\n	</tr>\r\n    </table>\r\n</div>\r\n', '2008-09-17 09:38:54', '2008-09-17 09:38:52', '2008-09-17 09:38:54', '2008-09-17 09:38:52');
