INSERT INTO `electronic_text` VALUES ('svsbody14', '<div class=\"mframe\">\r\n    <table align=\"center\" id=\"id=\"_ctl0_DataList3\" \" cellspacing=\"0\" border=\"0\" width=\"476\" ;border-collapse:collapse;\">\r\n	<tr>\r\n		<td style=\"width:25%;\">\r\n			<div style=\"verticle-align:top;height:100%\">\r\n			     <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\">\r\n				 <tr>\r\n					<td class=\"tl\"></td>\r\n					<td class=\"ttitle\">\r\n                                                                                    <table class=\"\" cellpadding=\"0\" cellspacing=\"0\" border=\"0\">\r\n						 <tr>\r\n							   <td class=\"ttitle\">\r\n							<span><A name=\"bookmark1064\">江西联通</A></span></td>\r\n						 </tr>\r\n					     </table>\r\n                                                                                  </td>\r\n					  <td class=\"tr\"></td>\r\n				  </tr>\r\n			       </table>\r\n\r\n			      <table width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" border=\"0\" style=\"border:1px solid #cccccc;\">\r\n				<tr>\r\n					<td colspan=\"2\" height=\"10\"></td>\r\n				</tr>\r\n				<tr width=\"100%\">\r\n					 <td width=\"6\" rowspan=\"2\" valign=\"top\">\r\n                                                                                      <table width=\"90%\">\r\n						<tr>\r\n							<td></td>\r\n						</tr>\r\n					     </table>\r\n\r\n					</td>\r\n					<td>\r\n                                                                                     <table width=\"95%\" border=\"0\" align=\"center\">\r\n						  <tr>\r\n							<td>\r\n								  <div class=\"lh\"> &nbsp;&nbsp;&nbsp;<a class=\"bb\" href=\"/cms/html/chenggonganli/anxingyefenlei/dianxin/2007/0420/1064.html\">    由于网络设备的不断增加，因此网络拓扑图对江西联通网管人员就显得至关重要。面对这点需求，SiteView NNM 提供了强大的支持。通过软件提供的搜索功能可以迅速搜索到网内的所有网络资源，并自动生成拓扑图，用自带的图库显示出所有资源，同时在资源上显示该设备的服</a>								  </div>\r\n							</td>\r\n						</tr>\r\n					     </table>\r\n					</td>										  </tr>											   <tr>\r\n					  <td